class Product extends Varien_Object {
	 
	public function run() {  
		
		$_attributes = array('cabinet_height' => 'height', 'cabinet_width' => 'width', 'cabinet_depth' => 'depth');
			
		foreach(Mage::getModel('catalog/product')->getCollection()->addAttributeToSelect("*") as $_product) {
			 
			 foreach($_attributes as $_targetCode => $_sourceCode) {
				 
				 if($_product->getData($_sourceCode)) { 
				  	 
					 $_product->setData($_targetCode, $this->getAttributeOptionId($_targetCode, $_product->getData($_sourceCode)));
					 
					 $_product->getResource()->saveAttribute($_product, $_targetCode);
				 } 
			 } 
		}
	}
	
	protected function _getSetup() {
		 
		if($this->_setup == null) { 
			
			$this->_setup = Mage::getModel('eav/entity_setup', 'core_setup');
		} 
		
		return $this->_setup;
	}
		
	public function getAttribute($code){
		
		return Mage::getModel('catalog/resource_eav_attribute')->loadByCode('catalog_product', $code); 
	}
	
	public function getProduct(){
	
		return Mage::getModel('catalog/product');
	}
	
	protected function getAttributeOptionId($field, $value) { 
		
		$attribute = $this->getAttribute($field);	  
		
		if(!$value || !$attribute || !$attribute->getId()) {
			return ''; 
		}
		
		$optionId = '';
		$options = $attribute->getSource()->getAllOptions(false);
		
		if($options && count($options) > 0) {
			foreach($options as $option){
				if(trim(strtolower($option['label'])) ==  strtolower($value)){
					$optionId = $option['value'];
					break;
				}
			}
		}
		 		
		if(!$optionId) {
			$option = '';
			$option['attribute_id'] = $attribute->getAttributeId();
			$option['value']['option'][0] = $value;  
			$option['order']['option'] = ''; 
			$this->_getSetup()->addAttributeOption($option);
			
			$attribute = $this->getAttribute($field);
			$options = $attribute->getSource()->getAllOptions(false);
			if($options && count($options) > 0) {
				foreach($options as $option){
					if(trim(strtolower($option['label'])) ==  strtolower($value)){
						$optionId = $option['value'];
						break;
					}
				}
			} 
		} 
		
		return $optionId; 
	}	
